import React, { Component } from 'react'

class Counter extends Component{
    constructor(props){
        super(props)
        this.state={
            count:0
        }
    }

    increment()
    {
       // this.state.count=this.state.count+1 //does not call render method for changes in count.
        this.setState({
            count:this.state.count+1
        })
    }
    incrementFive()
    {
        this.increment()
        this.increment()
        this.increment()
        this.increment()
        this.increment()
    }
    render(){
        return (
            <div>
                <h1>{this.state.count}</h1>
                <button onClick={()=>this.increment()}>increment</button>
            </div>
        )
    }
}

export default Counter;
